import React from 'react';
import {
    Container
} from '@mui/material';
// import { grey } from '@mui/material/colors';


// const heroImagePath = './public/hero.jpg';
const heroStyle = {
    backgroundImage: `url(./public/hero.jpg)`,
    border: 'solid 5px black',
    width: '100%',
    height: '90vh'
}

const Hero = () => {
    return (
        <Container
            sx={heroStyle}
        >

        </Container>
    )
}

export default Hero;
